V8:
Bina Milli qvardiyanin yanindadir qosa zapravkaya yaxin binada yekunnasmaq uzredir hal hazirda rengi vurulur hər bir blokda iki ədəd səssiz və sürətli liftlər;
müasir mühəndis kommunikasiyalar və texnoloji qurğular;
blokların girişində domofon sistemləri.
Ev qaz kəmərinə və digər mərkəzi şəhər kommunikasiyalarına qoşulur.
